import React from "react"; 
import '../App.css';

function PlayerInfo() {
    const playerName = "Battleship";
    const playerCash = 1380;
    const totalCash = 1500;
    const propertyColors = ['red', 'red', 'red', 'yellow', 'yellow', 'white', 'white','purple','purple','purple','orange','blue']; // Example
    const historyEvents = [
      "Welcome to Monopoly",
      "Battleship moved to CONNECTICUT AVENUE.",
      "Battleship purchased CONNECTICUT AVENUE, for $120."
    ];

    return (
      <div className="player-info">
        <PlayerHeader playerName={playerName} playerCash={playerCash} totalCash={totalCash}/>
        <PropertyStatus propertyColors={propertyColors} />
        <BankInfo/>
        <History historyEvents={historyEvents} />
      </div>
    );
  }


  export default PlayerInfo;
